import React, { useState } from 'react';
import { QElementComponent, useQElementAnimation } from '../qelements';

/**
 * Animation Template - Smooth Animations
 * 
 * This template demonstrates QElements animation system:
 * - Smooth transitions
 * - Keyframe animations
 * - Animation controls
 * - Performance-optimized animations
 * 
 * Edit this template to experiment with animations!
 */

const AnimationTemplate = () => {
  const { addAnimation, removeAnimation, animations } = useQElementAnimation('animation_template');
  const [isAnimating, setIsAnimating] = useState(false);
  const [animationType, setAnimationType] = useState('fadeIn');

  const animationConfigs = {
    fadeIn: {
      name: 'fadeIn',
      duration: 1000,
      timingFunction: 'ease-in-out',
      keyframes: [
        { opacity: 0, transform: 'translateY(20px)' },
        { opacity: 1, transform: 'translateY(0)' }
      ]
    },
    slideIn: {
      name: 'slideIn',
      duration: 800,
      timingFunction: 'ease-out',
      keyframes: [
        { transform: 'translateX(-100%)' },
        { transform: 'translateX(0)' }
      ]
    },
    scaleIn: {
      name: 'scaleIn',
      duration: 600,
      timingFunction: 'ease-in-out',
      keyframes: [
        { transform: 'scale(0.8)', opacity: 0 },
        { transform: 'scale(1)', opacity: 1 }
      ]
    },
    bounce: {
      name: 'bounce',
      duration: 1200,
      timingFunction: 'cubic-bezier(0.68, -0.55, 0.265, 1.55)',
      keyframes: [
        { transform: 'translateY(0)' },
        { transform: 'translateY(-20px)' },
        { transform: 'translateY(0)' }
      ]
    }
  };

  const handleToggleAnimation = () => {
    if (isAnimating) {
      removeAnimation(animationType);
      setIsAnimating(false);
    } else {
      addAnimation(animationType, animationConfigs[animationType as keyof typeof animationConfigs]);
      setIsAnimating(true);
    }
  };

  const handleAnimationChange = (type: string) => {
    if (isAnimating) {
      removeAnimation(animationType);
      setAnimationType(type);
      addAnimation(type, animationConfigs[type as keyof typeof animationConfigs]);
    } else {
      setAnimationType(type);
    }
  };

  return (
    <div style={{ marginBottom: '2rem' }}>
      <h3>✨ Animation Template - Smooth Animations</h3>
      <p>Smooth animations with QElements animation system.</p>

      {/* Animation Controls */}
      <div style={{ marginBottom: '1rem', display: 'flex', gap: '10px', flexWrap: 'wrap' }}>
        <button onClick={handleToggleAnimation}>
          {isAnimating ? '⏹️ Stop Animation' : '▶️ Start Animation'}
        </button>
      </div>

      {/* Animation Type Selector */}
      <div style={{ marginBottom: '1rem', display: 'flex', gap: '10px', flexWrap: 'wrap' }}>
        <button 
          onClick={() => handleAnimationChange('fadeIn')}
          style={{ 
            backgroundColor: animationType === 'fadeIn' ? '#667eea' : '#f8f9fa',
            color: animationType === 'fadeIn' ? 'white' : '#333'
          }}
        >
          Fade In
        </button>
        <button 
          onClick={() => handleAnimationChange('slideIn')}
          style={{ 
            backgroundColor: animationType === 'slideIn' ? '#667eea' : '#f8f9fa',
            color: animationType === 'slideIn' ? 'white' : '#333'
          }}
        >
          Slide In
        </button>
        <button 
          onClick={() => handleAnimationChange('scaleIn')}
          style={{ 
            backgroundColor: animationType === 'scaleIn' ? '#667eea' : '#f8f9fa',
            color: animationType === 'scaleIn' ? 'white' : '#333'
          }}
        >
          Scale In
        </button>
        <button 
          onClick={() => handleAnimationChange('bounce')}
          style={{ 
            backgroundColor: animationType === 'bounce' ? '#667eea' : '#f8f9fa',
            color: animationType === 'bounce' ? 'white' : '#333'
          }}
        >
          Bounce
        </button>
      </div>

      {/* Animated Container */}
      <QElementComponent elementId="animation_template" style={{ 
        padding: 20, 
        backgroundColor: '#e8f5e8',
        borderRadius: 8,
        border: '2px solid #4caf50',
        marginBottom: '20px'
      }}>
        <h4>Animated Container</h4>
        <p>I can have smooth animations applied to me!</p>
        <p><strong>Current Animation:</strong> {animationType} {isAnimating ? '(Active)' : '(Inactive)'}</p>

        {/* Animated Children */}
        <QElementComponent elementId="animation_template" style={{ 
          margin: '10px 0', 
          padding: 15, 
          backgroundColor: '#fff3e0',
          borderRadius: 4,
          border: '1px solid #ff9800'
        }}>
          <h5>Animated Child 1</h5>
          <p>Animations can be applied to children too!</p>
        </QElementComponent>

        <QElementComponent elementId="animation_template" style={{ 
          margin: '10px 0', 
          padding: 15, 
          backgroundColor: '#f3e5f5',
          borderRadius: 4,
          border: '1px solid #9c27b0'
        }}>
          <h5>Animated Child 2</h5>
          <p>Multiple children can have animations!</p>
        </QElementComponent>
      </QElementComponent>

      {/* Animation Info */}
      <div style={{ 
        marginTop: '20px', 
        padding: '15px', 
        backgroundColor: '#f8f9fa', 
        borderRadius: '8px',
        border: '1px solid #dee2e6'
      }}>
        <h5>Current Animation Config:</h5>
        <pre style={{ fontSize: '12px', background: '#ffffff', padding: '10px', borderRadius: '4px' }}>
          {JSON.stringify(animationConfigs[animationType as keyof typeof animationConfigs], null, 2)}
        </pre>
        <p style={{ fontSize: '12px', color: '#6c757d', marginTop: '10px' }}>
          Active Animations: {animations.length > 0 ? animations.map(a => a.name).join(', ') : 'None'}
        </p>
      </div>
    </div>
  );
};

export default AnimationTemplate;
